INSERT INTO public.component VALUES ('1286a0a8-c987-48a4-87a6-4df990b2e836', 7, 'c6af4599-455e-4e44-8392-ae39031d63d2', '46ef1290-fa97-406b-8aab-4bffffb84d2d', '2019-05-16 10:17:33.356942+00', 4, '{"data":"We are building a calculator that can take in inputs such as mathematical formulas or complex forms and output similar forms. This requires we program in knowledge of how certain functions work, and how they works with other functions. Imagine taking this calculator program through a Bachelor''s Degree in Mathematics, and every formula or interaction would be programmed in.\n\nNow obviously we won''t find all of these formulas, so we need to have a way of adding new ones. This is where we will support community add-ons to our project. "}');
